INSERT INTO seller.book (author, book_category, book_condition, cover, created_at, description, isbn, page_count, price, title, updated_at) VALUES ('Fyodor Dostoevsky', 'Literary Fiction', 'New', 'https://bookeroo-dev-bucket.s3.ap-southeast-2.amazonaws.com/2021-10-08T11%3A58%3A34.604_The%20Brothers%20Karamazov.jpg', '2021-10-08 11:58:35.152000', 'The Brothers Karamazov, also translated as The Karamazov Brothers, is the last novel by Russian author Fyodor Dostoevsky. Dostoevsky spent nearly two years writing The Brothers Karamazov, which was published as a serial in The Russian Messenger from January 1879 to November 1880.', '9780192835093', '738', '13.05', 'The Brothers Karamazov', null);
INSERT INTO seller.book (author, book_category, book_condition, cover, created_at, description, isbn, page_count, price, title, updated_at) VALUES ('Ernest Hemingway', 'Literary Fiction', 'New', 'https://bookeroo-dev-bucket.s3.ap-southeast-2.amazonaws.com/2021-10-08T11%3A58%3A36.205_The%20Old%20Man%20and%20the%20Sea.jpg', '2021-10-08 11:58:36.456000', 'The Old Man and the Sea is a short novel written by the American author Ernest Hemingway in 1951 in Cayo Blanco, and published in 1952. It was the last major work of fiction written by Hemingway that was published during his lifetime.', '9788804325963', '128', '8.79', 'The Old Man and the Sea', null);
INSERT INTO seller.book (author, book_category, book_condition, cover, created_at, description, isbn, page_count, price, title, updated_at) VALUES ('J. K. Rowling', 'Literary Fiction', 'New', 'https://bookeroo-dev-bucket.s3.ap-southeast-2.amazonaws.com/2021-10-08T11%3A58%3A37.492_Harry%20Potter%20and%20the%20Sorcerer%27s%20Stone.jpg', '2021-10-08 11:58:37.729000', 'Harry Potter, an eleven-year-old orphan, discovers that he is a wizard and is invited to study at Hogwarts. Even as he escapes a dreary life and enters a world of magic, he finds trouble awaiting him.', '9780807286005', '345', '64.27', 'Harry Potter and the Sorcerer''s Stone', null);
