INSERT INTO seller.book (author, book_category, book_condition, cover, created_at, description, isbn, page_count, price, title, updated_at) VALUES ('Colleen Hoover', 'Literary Fiction', 'New', 'https://bookeroo-dev-bucket.s3.ap-southeast-2.amazonaws.com/2021-10-08T11%3A58%3A40.526_It%20Ends%20With%20Us.jpg', '2021-10-08 11:58:40.900000', 'Lily hasn''t always had it easy, but that''s never stopped her from working hard for the life she wants. She''s come a long way from the small town in Maine where she grew up.', '9783745600018', '290', '12.99', 'It Ends With Us', null);
INSERT INTO seller.book (author, book_category, book_condition, cover, created_at, description, isbn, page_count, price, title, updated_at) VALUES ('Sally Rooney', 'Literary Fiction', 'New', 'https://bookeroo-dev-bucket.s3.ap-southeast-2.amazonaws.com/2021-10-08T11%3A58%3A42.119_Beautiful%20World%2C%20Where%20Are%20You%3A%20A%20Novel.jpg', '2021-10-08 11:58:42.644000', 'Beautiful World, Where Are You is a novel by Sally Rooney, released on 7 September 2021.', '9781039002654', '353', '32.99', 'Beautiful World, Where Are You: A Novel', null);